import axios from 'axios'

class TodoDataService{
    retrieveAllTodos(name){
        return axios.get(`http://localhost:8080/restfulwebservices/users/${name}/todos`); // we are returning the Promise back, and WelcomeComponent will decide what to do if it is successfull / unsuccessfull
       // console.log("Executed")
    }
   
}

export default new TodoDataService();
